import "./Card.css";

function Card({ icon, color, data, unit, type }) {
  return (
    <div>
      <div className="card-icon"><img src={icon} alt={type} /></div>
      <div className="card-text">
        <div className="card-data">
          {data}
          {unit}
        </div>
        <div className="card-unit">{type}</div>
      </div>
    </div>
  );
}
export default Card;
